@Override
public String toString() {
  StringBuilder b = new StringBuilder();
  b.append("Box(");
  b.append(min[0]);
  b.append(" TO ");
  b.append(max[0]);
  for (int d=1; d<min.length; ++d) {
    b.append(", ");
    b.append(min[d]);
    b.append(" TO ");
    b.append(max[d]);
  }
  b.append(")");

  return b.toString();
}

